import React from "react";
const Contact = () => {
    return (

        <div className="container align-center">
            <ul class="collection">
                <li class="collection-item avatar">
                    <img src="./kartik.jpeg" alt="" className="circle" />
                    <span class="title">Kartik Bhatia</span>
                    <p>Web developer <br />
             Awesome communiction skills and sound technical knowledge
          </p>
                </li>
            </ ul>

        </div>
    );
};
export default Contact;
